import React,{Component} from "react";
import axios from "axios";

export default class Header extends Component {
    constructor(props){
      super(props);

      this.state = {
          header_menu : []
      }
    }

    static defaultProps = {
      apiUrl : "http://localhost/my-app1/"

    };

    componentDidMount = async () =>{
      const FormData = require('form-data');
      const data = new FormData();
      data.append('get_menus', 'true');
      data.append('menu_type', '1');

          const config = {
          method: 'post',
          url: this.props.apiUrl,
          headers: {},
          data : data
          };

          const menu = await axios(config);
          const make_menu = [];

          for(let key in menu.data){
            let row =  menu.data[key];

            make_menu.push({
              id : row.id,
              title : row.title,
              content : row.content
            });
          }

    }


    render(){
        return(
            <header class="full_w">
    <div class="full_w header_menu">
      <div class="center">
        <div class="navSectionWrapper full_w ">
        <a href="#" class="logo">
          <img src="assets/image/logo-org.svg" /><span>Organic</span>
        </a>
          
        <ul class="menu">
         <li><a href="organic.html" class="lnk">Home</a></li>
         <li><a href="related-product.htm" class="lnk">Products</a></li>
         <li><a href="organic_blog.html" class="lnk" target="_blank">Blog</a></li>
         <li><a href="organic_about.html" class="lnk" target="_blank">About Us</a></li>
         <li><a href="organic_contact.html" class="active" target="_blank">Contact</a></li>   
        </ul>
          <div class="mobilenav">
            <div class="l1"></div>
            <div class="l2"></div>
            <div class="l3"></div>
          </div>
    </div>
  
    
  
  </div>
      
    </div>
  </header>
        )
    }
}
